WOMT_aTexte['popup_impressum_text_datenschutz'][0]='<h1 class="orange">Datenschutzerklärung</h1><p>Wir, die Bundeszentrale für politische Bildung/bpb als Lizenzgeber des Wahl-O-Mat und Inhaber der Domain www.wahl-o-mat.de, nehmen den Schutz Ihrer persönlichen Daten und Ihr Recht auf informationelle Selbstbestimmung sehr ernst und halten uns selbstverständlich an die datenschutzrechtlichen Regeln. Als öffentlich-rechtliche Stelle des Bundes unterliegen wir den Bestimmungen des Bundesdatenschutzgesetzes, dessen Zweck der Schutz vor Beeinträchtigungen des Persönlichkeitsrechts durch den Umgang mit personenbezogenen Daten ist.<br/><br/>Die Bundeszentrale für politische Bildung/bpb hat technische und organisatorische Maßnahmen getroffen, die sicherstellen, dass die Vorschriften über den Datenschutz sowohl von uns als auch von externen Dienstleistern beachtet werden.<br/><br/><b>Zugriff auf die Seiten von wahl-o-mat.de</b><br/>Jeder Zugriff auf unsere Homepage und jeder Abruf einer auf der Homepage hinterlegten Datei werden protokolliert. Die Speicherung dient internen systembezogenen und statistischen Zwecken. Protokolliert werden: Name der abgerufenen Datei, Datum und Uhrzeit des Abrufs, übertragene Datenmenge, Meldung über erfolgreichen Abruf, Webbrowser und anfragende Domain. Die IP Adressen der anfragenden Rechner werden anonymisiert protokolliert, eine Rückverfolgung ist nicht möglich. Die Logfiles selbst werden maximal vier Wochen gespeichert, sie werden monatlich automatisch gelöscht.<br/><br/>Die bpb nimmt am Zählverfahren der Firma Infonline teil. Dazu sind in die einzelnen Seiten so genannte Zählpixel, kleine transparente Bilder, eingebaut, deren Abruf von der Firma Infonline gezählt wird. Dabei werden keinerlei Informationen über die Benutzer gesammelt, so werden auch keine IP-Adressen gespeichert. Die Daten werden ausschließlich in aggregierter Form auf den Seiten von Infonline gespeichert.<br/><br/><b>Personenbezogene Daten</b><br/>Personenbezogene Daten sind Informationen zu Ihrer Person, die dazu genutzt werden können, Ihre Identität zu erfahren - etwa Ihren richtigen Namen, Ihre Adresse, Postanschrift oder Telefonnummer. Informationen, die keine Rückschlüsse auf eine bestimmte oder bestimmbare Person zulassen, fallen nicht darunter. Bei der Nutzung des Wahl-O-Mat werden keinerlei personenbezogene Daten erhoben. <br/><br/>Soweit Fremdfirmen im Auftrag der Bundeszentrale für politische Bildung tätig werden - etwa, um den Server der Webseite zu pflegen -, werden diese Firmen ausdrücklich darauf verpflichtet, die Daten ausschließlich im Rahmen dieser Zweckbestimmung zu verwenden und anschließend - nach Ablauf eventuell bestehender gesetzlicher Fristen - zu löschen.<br/> <br/><b>Cookies</b><br/>Der Wahl-O-Mat verwendet insgesamt zwei so genannte Cookies. Sie dienen dazu, sicherzustellen, dass ein und derselbe Nutzer nicht mehrmals in unserer Nutzungsstatistik gezählt wird. Cookies sind kleine Textdateien, die auf Ihrem Rechner abgelegt werden und die Ihr Browser speichert. Cookies richten auf Ihrem Rechner keinen Schaden an und enthalten keine Viren. Der Wahl-O-Mat funktioniert auch ohne Cookies.<br/><br/><b>Umfrage</b><br/>Am Ende des Wahl-O-Mat wird einer zufälligen Auswahl von Nutzerinnen und Nutzern die Möglichkeit angeboten, an einer wissenschaftlichen Evaluation des Wahl-O-Mat teilzunehmen. Die Teilnahme ist freiwillig, die Umfrage ist anonym, d.h. bei ihr werden ebenfalls keine personenbezogenen Daten erfasst. Um Ihr Wahl-O-Mat Ergebnis mit Ihren Antworten im Fragebogen zu korrelieren, wird die Webadresse ihres Wahl-O-Mat-Ergebnisses (Query Session-ID) mit den Antworten im Fragebogen verknüpft. Ihre IP-Adresse wird hierbei jedoch nicht gespeichert. Auf der Seite <a tabindex="102" title="Universität Düsseldorf (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.wahl-o-mat.uni-duesseldorf.de/" target="_blank">www.wahl-o-mat.uni-duesseldorf.de/</a> können Sie die Ergebnisse der Evaluationen einsehen.<br/><br/><b>Datenschutzerklärung für die Nutzung von Social-Plugins (Share-/, Tweet-, und +1-Button)</b><br/>Auf <a tabindex="103" title="www.wahl-o-mat.de (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.wahl-o-mat.de" target="_blank">www.wahl-o-mat.de</a> wird das zweistufige jQuery-Plug-In der Internetplattform Heise.de zur Einbindung von Social Media Funktionalitäten der Dienste Facebook und Twitter eingesetzt. Das Plug-In ermöglicht eine Freischaltung der Social Media Funktionalitäten nach expliziter Zustimmung des Anwenders. Durch den Klick auf einen dieser Buttons erteilt der Anwender seine Zustimmung, Daten an den Betreiber der jeweiligen Plattform zu übermitteln.<br/><br/><b>Datenschutzerklärung für die Nutzung von Facebook-Plugins (Share-Button)</b><br/>Nach der Aktivierung durch den Nutzer (s.o.) sind auf unseren Seiten Plugins des sozialen Netzwerks Facebook, 1601 South California Avenue, Palo Alto, CA 94304, USA integriert. Die Facebook-Plugins erkennen Sie an dem Facebook-Logo oder der ?Empfehlen?-Schaltfläche auf unserer Seite. Eine Übersicht über die Facebook-Plugins finden Sie hier <a tabindex="104" title="https://developers.facebook.com/docs/plugins/ (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="https://developers.facebook.com/docs/plugins/" target="_blank">https://developers.facebook.com/docs/plugins/</a>. Wenn Sie unsere Seiten besuchen und die Funktionalität des "Empfehlens" explizit aktivieren (s.o.), wird über das Plugin eine direkte Verbindung zwischen Ihrem Browser und dem Facebook-Server hergestellt. Facebook erhält dadurch die Information, dass Sie mit Ihrer IP-Adresse unsere Seite besucht haben. Wenn Sie den Facebook "Empfehlen-Button? anklicken, während Sie in Ihrem Facebook-Account eingeloggt sind, können Sie die Inhalte unserer Seiten auf Ihrem Facebook-Profil verlinken. Dadurch kann Facebook den Besuch unserer Seiten Ihrem Benutzerkonto zuordnen. Wir weisen darauf hin, dass wir als Anbieter der Seiten keine Kenntnis vom Inhalt der übermittelten Daten sowie deren Nutzung durch Facebook erhalten. Weitere Informationen hierzu finden Sie in der Datenschutzerklärung von Facebook unter <a tabindex="105" title="http://de-de.facebook.com/policy.php (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://de-de.facebook.com/policy.php" target="_blank">http://de-de.facebook.com/policy.php</a> <br/><br/><b>Datenschutzerklärung für die Nutzung von Twitter</b><br/>Nach der Aktivierung durch den Nutzer (s.o.) sind auf unseren Seiten Plugins des Dienstes Twitter integriert. Diese Funktionen werden angeboten durch die Twitter Inc., 795 Folsom St., Suite 600, San Francisco, CA 94107, USA. Durch das Benutzen von Twitter und der Funktion "Re-Tweet? werden die von Ihnen besuchten Webseiten mit Ihrem Twitter-Account verknüpft und anderen Nutzern bekannt gegeben. Dabei werden auch Daten an Twitter übertragen.<br/>Wir weisen darauf hin, dass wir als Anbieter der Seiten keine Kenntnis vom Inhalt der übermittelten Daten sowie deren Nutzung durch Twitter erhalten. Weitere Informationen hierzu finden Sie in der Datenschutzerklärung von Twitter unter <a tabindex="106" title="http://twitter.com/privacy (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://twitter.com/privacy" target="_blank">http://twitter.com/privacy</a>. Ihre Datenschutzeinstellungen bei Twitter können Sie in den Konto-Einstellungen unter <a tabindex="107" title="http://twitter.com/account/settings (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://twitter.com/account/settings" target="_blank">http://twitter.com/account/settings</a> ändern.<br/><br/><b>Kooperationspartner</b><br/>Diese Datenschutzerklärung gilt nur für den Server von www.wahl-o-mat.de. Der Wahl-O-Mat wird jedoch auch von Kooperations- und Medienpartnern der bpb auf deren eigenen Servern betrieben. Auf diesen kann es andere Datenschutzrichtlinien geben. Die bpb übernimmt keine Verantwortung für die Datenschutzrichtlinien dieser externen Webseiten.<br/><br/>Kooperations-/Medienpartner der bpb stellen der bpb lediglich täglich die Zahl der insgesamt erfolgten Nutzungen des Wahl-O-Mat auf deren Servern zu, die in die Nutzungsstatistik auf <a tabindex="109" title="www.wahl-o-mat.de (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.wahl-o-mat.de" target="_blank">www.wahl-o-mat.de</a> eingehen.<br/><br/><b>Auskunftsrecht</b><br/>Sie haben jederzeit das Recht auf Auskunft über die bezüglich Ihrer Person gespeicherten Daten, deren Herkunft und Empfänger sowie den Zweck der Speicherung. Auskunft über die gespeicherten Daten gibt die Datenschutzbeauftragte der Bundeszentrale für politische Bildung: <a title="" class="link_normal" href="mailto:diehl@bpb.de" tabindex="110">diehl@bpb.de</a>.<br/><br/><b>Fragen und Kommentare</b><br/>Fragen und Kommentare<br/>Wenn Sie Fragen haben, die diese Datenschutzerklärung nicht beantworten konnte, wenn Sie zu einem Punkt weitere Informationen haben möchten oder Anregungen oder Kommentare haben, können Sie sich gern direkt per E-Mail an die Datenschutzbeauftragte der Bundeszentrale für politische Bildung wenden: <a tabindex="111" title="" href="mailto:diehl@bpb.de">diehl@bpb.de</a>.<br/><br/>Bonn, den 29. August 2013</p>';
