WOMT_aTexte['popup_impressum_text_text'][0]='<p>Der Wahl-O-Mat zur Bundestagswahl 2013 ist ein Produkt der <a tabindex="2" title="Bundeszentrale für politische Bildung (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.bpb.de" target="_blank">Bundeszentrale für politische Bildung/bpb</a>.</p><p>Thesen und Inhalte des Wahl-O-Mat wurden von einem Redaktionsteam aus 25 Jungwählerinnen und Jungwählern im Alter von 18 bis 26 Jahren aus allen Teilen der Bundesrepublik entwickelt. Beraten wurden sie dabei von dem Wahl-O-Mat Team der bpb und den Wissenschaftlern Prof. Stefan Marschall, Wolf Dittmayer, Christian K. Schmidt und Tanja Binder. <br/><br/>Redaktionsschluss: 25. Juli 2013.</p><span><strong>Herausgeber</strong></span><p>Bundeszentrale für politische Bildung/bpb, Bonn Š 2013<br/>Verantwortlich gemäß § 55 RStV: Thorsten Schilling<br/><a tabindex="10" title="" href="mailto:schilling@bpb.de">schilling@bpb.de</a><br/></p><span><strong>Projektleitung</strong></span><p><br/><b>für die Bundeszentrale für politische Bildung/bpb</b><br/>Pamela Brandt<br/>Martin Hetterich<br/>Gereon Schloßmacher (Volontär)<br/>Adenauerallee 86<br/>53113 Bonn<br/>Tel.: 0228 99515-0<br/>Fax: 0228 99515-405<br/>E-Mail: <a tabindex="11" title="" class="link_normal" href="mailto:info@wahl-o-mat.de">info@wahl-o-mat.de</a><br/>Internet: <a tabindex="12" title="Bundeszentrale für politische Bildung (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.bpb.de" target="_blank">www.bpb.de</a></p><span><strong>Inhalt und Redaktion</strong></span><br/><p><img class="pic1" alt="Gruppenfoto der Redaktion" title="Gruppenfoto der Redaktion" width="560" height="373" src="media/pix_change/pic_impressum.jpg"/>Thomas Andonie<br/>Johannes Moritz Bartsch<br/>Anna Bosch<br/>Anni Michelle Deutsch<br/>Fabian Drywa<br/>Sabine Eberhardt<br/>Frederic Pascal Genreit<br/>Anna Gründler<br/>Lisa Gürth<br/>Patrick Gwinner<br/>Max Haslböck<br/>Anna Maria Jansen<br/>Ruth Kichmann<br/>Sophie Leins<br/>Marcus Marosz<br/>David Meuresch<br/>Lara Moritz<br/>Rebecka Müsel<br/>Mareike Riesinger<br/>Fabian Schiffelholz<br/>Tom Schwesig<br/>Mareike Spychala<br/>Christian Stuffrein<br/>Johannes Uhl<br/>Pauline Westerbarkey<br/><br/>Bennet Krebs (studentischer Mitarbeiter)<br/>Philipp Weber (studentischer Mitarbeiter)</p><span><strong>Inhaltliche Beratung</strong></span><br/><p>Prof. Dr. Stefan Marschall, Heinrich-Heine-Universität Düsseldorf<br/>Dipl. Soz.-Päd. Wolf Dittmayer, Selbständiger Organisationsberater, Köln <br/>Dipl. Soz.-Wiss. Christian K. Schmidt, Heinrich-Heine-Universität Düsseldorf<br/>Tanja Binder, M.A., Politikwissenschaftlerin, Berlin<br/><br/>Prof. Dr. Tim Spier, Universität Siegen<br/>Prof. Dr. Christoph Strünck, Universität Siegen<br/>Stephan Trinius, M.A., Journalist, Bonn<br/></p><span><strong>Umsetzung, Gestaltungskonzept & Design</strong></span><br/><p>3pc GmbH Neue Kommunikation, Berlin<br/>Email: <a tabindex="19" title="" class="link_normal" href="mailto:info@3pc.de">info@3pc.de</a><br/>Internet: <a tabindex="20" title="3pc GmbH Neue Kommunikation (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.3pc.de" target="_blank">http://www.3pc.de</a></p><span><strong>Programmierung</strong></span><br/><p>GLAMUS GmbH<br/>E-Mail: <a tabindex="21" title="" class="link_normal" href="mailto:santo@glamus.de">santo@glamus.de</a><br/>Internet: <a tabindex="22" title="GLAMUS GmbH (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.glamus.de" target="_blank">http://www.glamus.de</a></p><span><strong>Lizenz</strong></span><br/><p><a tabindex="23" title="Pro Demos, NL-Amsterdam (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.stemwijzer.nl/" target="_blank">Pro Demos, NL-Amsterdam</a><br/>Supervision: <a tabindex="24" title="" class="link_normal" href="mailto:j.degraaf@stemwijzer.nl">Jochum de Graaf</a></p><p>Die Vervielfältigung, Verbreitung und die öffentliche Wiedergabe des Wahl-O-Mat ist nicht gestattet. Der Wahl-O-Mat ist urheberrechtlich geschützt.<br/></p>';
WOMT_aTexte['popup_faq_titel']=new Array();
WOMT_aTexte['popup_faq_titel'][0]='FAQ';
WOMT_aTexte['popup_faq_text']=new Array();
WOMT_aTexte['popup_faq_text'][0]='Hier finden Sie Antworten auf häufig gestellte Fragen zum Wahl-O-Mat.';
WOMT_aTexte['wahlomat_kopf_meta_author']=new Array();
WOMT_aTexte['wahlomat_kopf_meta_author'][0]='Bundeszentrale für politische Bildung';
WOMT_aTexte['popup_faq_9_text']=new Array();
WOMT_aTexte['popup_faq_9_text'][0]='Der Wahl-O-Mat ist ein Angebot zur politischen Bildung und Information, keine Wahlempfehlung. Er möchte zum einen wichtige Fragen der Wahl vorstellen und zum anderen die Auseinandersetzung des Users mit den zur Wahl zugelassenen Parteien unterstützen. Daher liegt in der Handhabung der Fokus auf der inhaltlichen Auseinandersetzung mit den einzelnen Thesen sowie mit den Parteien und deren Positionen.<br/><br/>Dazu gehört auch, dass die User zunächst eigenverantwortlich eine Entscheidung darüber treffen, welche Parteien für sie von Interesse sind und sie zur Berechnung des Vergleichs auswählen wollen.<br/><br/>Sie können bis zu acht Parteien gleichzeitig auswählen, mit denen Sie Ihre eigene Positionen vergleichen möchten. Die Reihenfolge der Parteien auf dieser Wahl-O-Mat-Seite richtet sich nach der Reihenfolge auf dem Stimmzettel. Keine der Parteien wurde im Wahl-O-Mat vorab ausgewählt. Die Auswahl obliegt allein dem User und kann jederzeit über den Button "zurück" neu ausgewählt werden.<br/><br/>Der Wahl-O-Mat richtet sich zudem insbesondere an Politik-Neulinge und Erst- und Jungwähler. Hier ist es besonders wichtig, zum einen die eigenständige und bewusste Auseinandersetzung zu fördern, zum anderen aber auch die Ergebnisse möglichst übersichtlich, klar strukturiert und leicht verständlich darzustellen. Dieses Ziel lässt sich mit einer selbst gewählten und immer wieder neu auszuwählenden begrenzten Anzeige der Parteien besser erreichen.<br/><br/>Damit Sie sich einen Überblick über alle im Wahl-O-Mat aufgeführten Parteien verschaffen können, hat die bpb zusätzlich auf der Parteien-Auswahl-Seite im Wahl-O-Mat hinter jeder Partei ein Parteienprofil des bpb-Angebots "Wer steht zur Wahl?"  <a tabindex="91" title="Wer steht zur Wahl? (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.wahl-o-mat.de/bundestagswahl2013/wszw.php" target="_blank">(www.wer-steht-zur-wahl.de)</a> verlinkt. So können Sie sich kurze Informationen über alle zur Wahl zugelassenen Parteien einholen und besonders über viele der kleineren Parteien mehr erfahren.<br/><br/>Dennoch können Sie Ihre Position mit allen Parteien im Wahl-O-Mat vergleichen:';
WOMT_aTexte['popup_faq_9_frage']=new Array();
WOMT_aTexte['popup_faq_9_frage'][0]='Warum kann ich maximal acht Parteien gleichzeitig in die Auswahl nehmen?';
WOMT_aTexte['popup_faq_8_frage']=new Array();
WOMT_aTexte['popup_faq_8_frage'][0]='Ich möchte mehr erfahren als nur das Endergebnis. Wie kann ich die Einstellungen der verschiedenen Parteien zu einzelnen Thesen erfahren und vergleichen?';
WOMT_aTexte['popup_faq_7_text']=new Array();
WOMT_aTexte['popup_faq_7_text'][0]='Es werden nur die Parteien in die Berechnung des Ergebnisses aufgenommen, die Sie zuvor ausgewählt haben. Übereinstimmungen hängen damit zusammen, dass die Mehrzahl der Thesen sachpolitische Themen zur Wahl anspricht. Bei diesen Thesen können extremistische Parteien Positionen vertreten, die mit denen anderer Parteien identisch sind. Bei einigen weiteren Thesen werden die Unterschiede zwischen diesen Parteien deutlich. Bitte schauen Sie sich entsprechend in der Darstellung auf der Ergebnisseite an, wie die als extremistisch eingestuften Parteien speziell bei diesen Thesen geantwortet haben. Welche Parteien als extremistisch eingestuft werden, können Sie auf den Seiten des Verfassungsschutzes nachlesen:<br/><a tabindex="71" title="Verfassungsschutzberichte des Bundesamtes für Verfassungsschutz (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.verfassungsschutz.de/verfassungsschutzberichte" target="_blank">http://www.verfassungsschutz.de/verfassungsschutzberichte</a><br/><br/>Einen informativen Überblick über alle zur Wahl zugelassenen Parteien finden Sie unter dem bpb-Angebot "Wer steht zur Wahl?", <a tabindex="72" title="Wer steht zur Wahl? (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.wahl-o-mat.de/bundestagswahl2013/wszw.php" target="_blank">www.wer-steht-zur-wahl.de</a>. ';
WOMT_aTexte['popup_faq_7_frage']=new Array();
WOMT_aTexte['popup_faq_7_frage'][0]='Warum kann es vorkommen, dass bei mir Übereinstimmungen mit einer vom Verfassungsschutz als extremistisch eingestuften Partei angezeigt werden?';
WOMT_aTexte['popup_faq_6_text']=new Array();
WOMT_aTexte['popup_faq_6_text'][0]='Aus unseren Nutzerbefragungen zum Wahl-O-Mat wissen wir, dass bei etwa 90 Prozent der Nutzer das Wahl-O-Mat-Ergebnis mit ihrer politischen Position genau oder ungefähr übereinstimmt. Nur 10 Prozent der Nutzer sind von ihrem Wahl-O-Mat-Ergebnis überrascht. Woran das im Einzelfall liegt, können wir nicht generell beantworten. Allerdings geben die 38 Thesen im Wahl-O-Mat nur einen Ausschnitt der politischen Themen wieder. Zudem gibt es zahlreiche weitere Gründe, warum Sie sich für eine Partei entscheiden können: Zum Beispiel weil Ihnen eine Politikerin oder ein Politiker dieser Partei besonders gut gefällt, eine Partei ein für Sie besonders wichtiges Thema vertritt oder eine Partei eine Ihnen wichtige Grundanschauung teilt.<br/><br/>Manchmal stimmen aber auch die eigenen Einschätzung zu einer Partei mit den tatsächlichen Positionen dieser Partei einfach nicht überein. Nutzen Sie Ihr überraschendes Wahl-O-Mat-Ergebnis, um sich genauer mit den Positionen der Parteien und Wählervereinigungen auseinanderzusetzen.';
WOMT_aTexte['popup_faq_6_frage']=new Array();
WOMT_aTexte['popup_faq_6_frage'][0]='Wie ist es möglich, dass ich als Ergebnis eine Partei erhalte, die ich überhaupt nicht erwartet habe?';
WOMT_aTexte['popup_faq_4_text']=new Array();
WOMT_aTexte['popup_faq_4_text'][0]='In solchen Fällen antworten Sie mit "neutral".';
WOMT_aTexte['popup_faq_4_frage']=new Array();
WOMT_aTexte['popup_faq_4_frage'][0]='Was kann ich antworten, wenn ich einer Aussage nur unter bestimmten Bedingungen zustimme?';
WOMT_aTexte['popup_faq_2_text']=new Array();
WOMT_aTexte['popup_faq_2_text'][0]='Der Wahl-O-Mat wurde in Deutschland erstmals zur Bundestagswahl 2002 eingesetzt. Er wurde von einer unabhängigen Redaktion, die aus jungen Erwachsenen besteht, in Kooperation mit der Bundeszentrale für politische Bildung/bpb und mit Unterstützung ihrer Partner und des niederländischen ProDemos entwickelt. Dabei ging der Wahl-O-Mat aus dem StemWijzer hervor. Das ist ein von ProDemos entwickelter Test, mit dem Sie feststellen können, wie Sie persönlich zu den Zielen und Positionen von Parteien stehen. Dieser Test gehört in den Niederlanden seit langem fest zum Vorwahlgeschehen.<br/><br/>Bei der Bundestagswahl 2002 wurde der Wahl-O-Mat mehr als 3,6 Millionen mal gespielt. Seitdem wurde er von der bpb bei zahlreichen Landtagswahlen, sowie den Europa- und Bundestagswahlen eingesetzt. Zur Bundestagswahl 2009 wurde er über 6,7 Millionen mal gespielt. Insgesamt wurde der Wahl-O-Mat seit 2002 im Vorfeld von Wahlen bereits rund 24 Millionen Mal genutzt.<br/><br/>Die Redaktion des Wahl-O-Mat für die Bundestagswahl 2013 bestand aus 25 jungen Erwachsenen im Alter zwischen 18 und 26 Jahren. Sie wurden unterstützt vom Wahl-O-Mat-Team der bpb sowie zahlreichen Politikwissenschaftlern. Die Redaktion hat die Thesen des Wahl-O-Mat entwickelt und formuliert. Den Parteien und sonstigen politischen Vereinigungen wurde eine Liste mit insgesamt 85 Thesen zugeschickt. Sie wurden gebeten, die Thesen entsprechend der Parteihaltung mit "stimme zu", "stimme nicht zu" oder "neutral" zu beantworten. Aus den ausgefüllten Listen wurden diejenigen Thesen rechnerisch ermittelt und entfernt, die keine ausreichende Unterscheidung der Parteien möglich machten. Die Redaktion hat aus den verbleibenden Thesen eine endgültige Auswahl von 38 Thesen getroffen, die in den Wahl-O-Mat eingebunden wurden. Die Parteien waren an der Endauswahl der Thesen nicht beteiligt.';
WOMT_aTexte['popup_faq_2_frage']=new Array();
WOMT_aTexte['popup_faq_2_frage'][0]='Wie ist der Wahl-O-Mat entwickelt worden? Sind die Parteien und Wählervereinigungen daran beteiligt gewesen?';
WOMT_aTexte['popup_faq_1_text']=new Array();
WOMT_aTexte['popup_faq_1_text'][0]='Die Bundeszentrale für politische Bildung/bpb hat alle Parteien und politischen Vereinigungen zur Teilnahme am Wahl-O-Mat eingeladen, die vom Bundeswahlausschuss zur Bundestagswahl 2013 mit einer Landesliste zugelassen wurden. Eine informative Übersicht aller zugelassenen Parteien finden Sie auf  <a tabindex="11" title="Wer steht zur Wahl? (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.wahl-o-mat.de/bundestagswahl2013/wszw.php" target="_blank">www.wer-steht-zur-wahl.de</a>.<br/><br/>29 von 30 zugelassene Parteien haben die Thesen bis zum Redaktionsschluss am 25. Juli 2013 beantwortet. Die CDU und die CSU haben die Thesen des Wahl-O-Mat gemeinsam beantwortet und nehmen gemeinsam am Wahl-O-Mat teil. Die Partei Die Rechte hat die Thesen des Wahl-O-Mat nicht beantwortet. Insgesamt sind so 28 Parteien im Wahl-O-Mat vertreten.<br/><br/>Grundsätzlich gilt als Kriterium, dass alle Parteien und politischen Vereinigungen am Wahl-O-Mat teilnehmen dürfen, die vom Bundeswahlleiter bzw. dem Bundeswahlausschuss als Partei anerkannt und deren Wahlvorschläge (Landeslisten) von den Landeswahlausschüssen zugelassen wurden. Einzelkandidaten werden nicht aufgenommen. Somit können aber auch Parteien im Wahl-O-Mat auftauchen, die vom Verfassungsschutz des Bundes oder der Länder beobachten werden und als "extremistisch" eingestuft werden. Welche Parteien als extremistisch eingestuft werden, können Sie auf den Seiten des Verfassungsschutzes nachlesen: <br/><br/><a tabindex="12" title="Verfassungsschutzberichte des Bundesamtes für Verfassungsschutz: (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.verfassungsschutz.de/verfassungsschutzberichte" target="_blank">Verfassungsschutzberichte des Bundesamtes für Verfassungsschutz</a><br/><br/>Zusätzlich kommt die bpb dem Informationsbedürfnis über alle zur Wahl zugelassenen Parteien und Wählervereinigungen auch weiterhin durch das Online-Angebot "Wer steht zur Wahl?" (<a tabindex="13" title="Wer steht zur Wahl? (Dieser Link öffnet sich in einem neuen Fenster.)" class="link_normal" href="http://www.wahl-o-mat.de/bundestagswahl2013/wszw.php" target="_blank">www.wer-steht-zur-wahl.de</a>) nach. ';
WOMT_aTexte['popup_faq_1_frage']=new Array();
WOMT_aTexte['popup_faq_1_frage'][0]='Nach welchen Kriterien werden die Parteien für den Wahl-O-Mat ausgesucht?';
